  const usersData = []

  const [userData, setUserData] = useState(usersData)

  const addNewUserHandler = (userData) => {}

  return (
    <div>
      <NewUser onAddNewUser={addNewUserHandler} />
      <UserList userData={userData} />
    </div>
  )
}

export default App
